import React, { useState, useEffect, useRef } from "react";
import { Box, Button as GrommetButton, Grommet } from "grommet";
import "../App.css";

const Start = ({ Finish }, answers) => {
  return (
    <div className="start">
      <button className="start_button" onClick={Finish(answers)}>
        결과 확인
      </button>
    </div>
  );
};

export default Start;
